import './App_66.css';

const App_66 = () => {
  return (
    <section class="menu">
      {/* title */}
      <div class="title">
        <h2>our menu</h2>
        <div class="underline"></div>
      </div>
      {/* <!-- filter buttons */}
    <div class="btn-container"></div>
    <div class="section-container"></div>
    </section>
  );
};

export default App_66;
